	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 461px; min-height: 448px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 0px; top: 0px; width: 461px; min-height: 448px;\"><p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 13pt; font-family: &quot;pt sans&quot;, sans-serif; color: rgb(0, 40, 87);\">Je hebt gemerkt dat je in je werk als klantadviseur de hele dag door te maken krijgt met klantinformatie en privacy. Houd je daarom aan de volgende 6&nbsp;basisregels:&nbsp;</span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 13pt; font-family: &quot;pt sans&quot;, sans-serif; color: rgb(0, 40, 87);\">​</span></p>\n\n<ol style=\"padding-left: 32px; padding-inline-start: 32px; font-size: 13pt;\">\n	<li style=\"font-size: 13pt; line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 13pt; font-family: &quot;pt sans&quot;, sans-serif; color: rgb(0, 40, 87);\">Stel altijd de benodigde <strong>controlevragen </strong>als iemand belt. In Brein vind je precies terug wat je wanneer moet vragen. Ga niet akkoord met halve antwoorden op deze vragen.</span></li>\n	<li style=\"font-size: 13pt; line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 13pt; font-family: &quot;pt sans&quot;, sans-serif; color: rgb(0, 40, 87);\">Twijfel over iemands identiteit? Overleg dan met een <strong>vraagbaak of je teamleider</strong>.&nbsp;</span></li>\n	<li style=\"font-size: 13pt; line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 13pt; font-family: &quot;pt sans&quot;, sans-serif; color: rgb(0, 40, 87);\">Gebruik altijd de <strong>AVG beslisboom </strong>als een verzekeringsnemer niet voor zichzelf belt.&nbsp;</span></li>\n</ol>\n\n<p style=\"font-size: 13pt; line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size: 13pt; font-family: &quot;pt sans&quot;, sans-serif; color: rgb(0, 40, 87);\">​</span></p></div></div>",
